import React from "react";

function UploadRoom() {
	return (
		<div className="bg-white min-vh-100 w-100 m-auto">
			<form className="p-4 w-50">
				<div className="row">
					<label className="form-label col-sm-6">Title</label>
					<input type="text" className="form-control col-sm-6" />
				</div>
			</form>
		</div>
	);
}

export default UploadRoom;
